import html from "../assets/img/html.svg";
import css from "../assets/img/css.svg";
import javascript from "../assets/img/javascript.svg";
import react from "../assets/img/react.svg";
import nodejs from "../assets/img/nodejs.svg";
import postgresql from "../assets/img/postgresql.svg"
import express from "../assets/img/express.svg"
import sequelize from "../assets/img/sequelize.svg"
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import arrow1 from "../assets/img/arrow1.svg";
import arrow2 from "../assets/img/arrow2.svg";
import colorSharp from "../assets/img/color-sharp.png"

export const Skills = () => {
  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };

  return (
    <section className="skill" id="skills">
        <div className="container">
            <div className="row">
                <div className="col-12">
                    <div className="skill-bx wow zoomIn">
                        <h2>Skills</h2>
                        <p>full stack developer with knowledge in both front-end and back-end web development. Strong skills in HTML, CSS, and JavaScript. Experienced in React, Node.js, and Express. Familiar with PostgreSQL and Sequelize..</p>
                        <Carousel responsive={responsive} infinite={true} className="owl-carousel owl-theme skill-slider">
                            <div className="item">
                                <img src={html} alt="html" />
                                <h5>Html</h5>
                            </div>
                            <div className="item">
                                <img src={css} alt="css" />
                                <h5>Css</h5>
                            </div>
                            <div className="item">
                                <img src={javascript} alt="javascript" />
                                <h5>JavaScript</h5>
                            </div>
                            <div className="item">
                                <img src={react} alt="react" />
                                <h5>React</h5>
                            </div>
                            <div className="item">
                                <img src={nodejs} alt="nodejs" />
                                <h5>NodeJs</h5>
                            </div>
                             <div className="item">
                                <img src={express} alt="express" />
                                <h5>ExpressJs</h5>
                            </div>
                            <div className="item">
                                <img src={postgresql} alt="postgresql" />
                                <h5>PostgreSQL</h5>
                            </div>
                            <div className="item">
                                <img src={sequelize} alt="sequelize" />
                                <h5>Sequelize</h5>
                            </div>
                           
                            
                        </Carousel>
                    </div>
                </div>
            </div>
        </div>
        <img className="background-image-left" src={colorSharp} alt="sharp" />
    </section>
  )
}
